export class SZipExtractor{
    constructor();

    /**
     * open a zip file
     * @param is7Zip true-7zfile
     * @param path filename
     * @param password password
     */
    Open(is7Zip:boolean,path:string,password:string):boolean;

    /**
     * extract to folder
     * @param destPath dest folder
     */
    ExtractTo(destPath:string):void;

    /**
     * call back this object
     */
    cbHandler:object;

    /**
     * callback function
     */
    onMsg:(state:number,iFile:number,fileCount:number)=>void;
}